import React from 'react';
import { Link, useLocation } from 'react-router-dom';
import styled from 'styled-components';
import { BarChart3, Plus, TrendingUp, CreditCard, PiggyBank, Bell, Target, FileText, History, User, LogOut } from 'lucide-react';
import { toast } from 'react-hot-toast';
import api from '../services/api';

const SidebarContainer = styled.div`
  width: 260px;
  height: 100vh;
  background: linear-gradient(180deg, #1e3a8a 0%, #1e40af 100%);
  position: fixed;
  left: 0;
  top: 0;
  display: flex;
  flex-direction: column;
  box-shadow: 2px 0 10px rgba(0, 0, 0, 0.1);
  z-index: 1000;
`;

const Logo = styled.div`
  padding: 1.5rem;
  border-bottom: 1px solid rgba(255, 255, 255, 0.1);
  text-align: center;
`;

const LogoText = styled.h1`
  color: white;
  font-size: 1.5rem;
  font-weight: bold;
  margin: 0;
  text-shadow: 0 2px 4px rgba(0, 0, 0, 0.3);
`;

const Navigation = styled.nav`
  flex: 1;
  padding: 1rem 0;
  overflow-y: auto;
`;

const NavItem = styled(Link)`
  display: flex;
  align-items: center;
  gap: 0.75rem;
  padding: 0.75rem 1.5rem;
  color: ${props => props.$active ? '#ffffff' : 'rgba(255, 255, 255, 0.8)'};
  text-decoration: none;
  font-weight: 500;
  transition: all 0.3s ease;
  position: relative;

  &:hover {
    background: rgba(255, 255, 255, 0.1);
    color: white;
  }

  ${props => props.$active && `
    background: rgba(255, 255, 255, 0.15);
    &::before {
      content: '';
      position: absolute;
      left: 0;
      top: 0;
      bottom: 0;
      width: 3px;
      background: #fbbf24;
    }
  `}
`;

const NavIcon = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  width: 20px;
  height: 20px;
`;

const UserSection = styled.div`
  padding: 1rem 1.5rem;
  border-top: 1px solid rgba(255, 255, 255, 0.1);
`;

const UserInfo = styled.div`
  display: flex;
  align-items: center;
  gap: 0.75rem;
  color: rgba(255, 255, 255, 0.9);
  margin-bottom: 1rem;
  font-size: 0.9rem;
`;

const LogoutButton = styled.button`
  display: flex;
  align-items: center;
  gap: 0.75rem;
  width: 100%;
  padding: 0.75rem;
  background: rgba(220, 53, 69, 0.2);
  color: #fca5a5;
  border: 1px solid rgba(220, 53, 69, 0.3);
  border-radius: 8px;
  cursor: pointer;
  font-weight: 500;
  transition: all 0.3s ease;

  &:hover {
    background: rgba(220, 53, 69, 0.3);
    color: white;
  }
`;

const Sidebar = ({ user, onLogout }) => {
  const location = useLocation();

  const navItems = [
    { path: '/', label: 'Dashboard', icon: BarChart3 },
    { path: '/add', label: 'Th√™m Chi ti√™u', icon: Plus },
    { path: '/income', label: 'Thu nh·∫≠p', icon: TrendingUp },
    { path: '/debt', label: 'Qu·∫£n l√Ω N·ª£', icon: CreditCard },
    { path: '/savings', label: 'Ti·∫øt ki·ªám', icon: PiggyBank },
    { path: '/reminders', label: 'L·ªùi nh·∫Øc', icon: Bell },
    { path: '/budget', label: 'Ng√¢n s√°ch', icon: Target },
    { path: '/reports', label: 'B√°o c√°o', icon: FileText },
    { path: '/history', label: 'L·ªãch s·ª≠', icon: History },
  ];

  const handleLogout = async () => {
    try {
      await api.logout();
      toast.success('ƒêƒÉng xu·∫•t th√†nh c√¥ng!');
    } catch (error) {
      console.error('Logout error:', error);
    } finally {
      onLogout();
    }
  };

  return (
    <SidebarContainer>
      <Logo>
        <LogoText>üí∞ Expense AI</LogoText>
      </Logo>

      <Navigation>
        {navItems.map(({ path, label, icon: Icon }) => (
          <NavItem 
            key={path}
            to={path} 
            $active={location.pathname === path}
          >
            <NavIcon>
              <Icon size={20} />
            </NavIcon>
            {label}
          </NavItem>
        ))}
      </Navigation>

      <UserSection>
        <UserInfo>
          <User size={18} />
          {user?.full_name || user?.email}
        </UserInfo>
        <LogoutButton onClick={handleLogout}>
          <LogOut size={18} />
          ƒêƒÉng xu·∫•t
        </LogoutButton>
      </UserSection>
    </SidebarContainer>
  );
};

export default Sidebar;
